# OEIS sequence: A346261

def ham(m, n):
    s, t = str(min(m, n))[::-1], str(max(m, n))[::-1]
    return len(t) - len(s) + sum(s[i] != t[i] for i in range(len(s)))
def aupton(terms):
    alst = [10]
    for n in range(2, terms+1):
        an = alst[-1] + 1
        while any(ham(an, aprev) < 2 for aprev in alst[::-1]):  an += 1
        alst.append(an)
    return alst
